in_source: |-
  let f1 = 1;
  let f2 = 2;
  let f3 = f1 + f2;
  let ans = f2;
  let max = 4000000;
  while( f3 < max ) {
    let f4 = f2 + f3;
    let f5 = f3 + f4;
    let f6 = f4 + f5;
    if (f5 < max) {
      ans = ans + f5;
    }
    f1 = f4;
    f2 = f5;
    f3 = f6;
  }
  print_int(ans);
